<?php

declare(strict_types=1);

namespace ApeDevDe\MicrosoftGraphSdk\Models;

/**
 * ChangeNotificationCollection
 */
class ChangeNotificationCollection
{
    /**
     * Contains an array of JSON web tokens (JWT) generated by Microsoft Graph for the application to validate the origin of the notifications. Microsoft Graph generates a single token for each distinct app and tenant pair for an item if it exists in the value array. Keep in mind that notifications can contain a mix of items for various apps and tenants that subscribed using the same notification URL. Only provided for change notifications with resource data. Optional.
     * @var string[]
     */
    private array $validationTokens = [];

    /**
     * The set of notifications being sent to the notification URL. Required.
     * @var string[]
     */
    private array $value = [];


    /**
     * @return string[]
     */
    public function getValidationTokens(): array
    {
        return $this->validationTokens;
    }

    /**
     * @param string[] $validationTokens
     */
    public function setValidationTokens(array $validationTokens): self
    {
        $this->validationTokens = $validationTokens;
        return $this;
    }

    /**
     * @return string[]
     */
    public function getValue(): array
    {
        return $this->value;
    }

    /**
     * @param string[] $value
     */
    public function setValue(array $value): self
    {
        $this->value = $value;
        return $this;
    }

}
